-06 08:51:25',1,'2021-04-22 20:57:17','9468FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9762,132636,'A syndrome produced by severe protein deficiency, characterized by retarded growth, changes in skin and hair pigment, edema, and pathologic changes in the liver, including fatty infiltration, necrosis, and fibrosis. The word is a local name in Gold Coast, Africa, meaning displaced child. Although first reported from Africa, kwashiorkor is now known throughout the world, but mainly in the tropics and subtropics. It is considered to be related to marasmus. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,'2021-04-22 20:49:04','9762FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9763,132636,'MARASME','fr',1,'2007-07-13 13:53:41',1,'2021-04-22 20:49:04','9763FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10003,133414,'Acute conjunctival inflammation in the newborn, usually caused by maternal gonococcal infection. The baby\'s eyes are contaminated during passage through the birth canal.','en',1,'2007-10-18 04:28:24',1,'2021-04-23 16:22:11','10003FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10318,134213,'Abnormal smallness of the head, usually associated with mental retardation. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,'2021-04-23 16:24:37','10318FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10354,134337,'Psychiatric illness or diseases manifested by breakdowns in the adaptational process expressed primarily as abnormalities of thought, feeling, and behavior producing either distress or impairment of function.','en',1,'2007-10-18 04:28:24',1,'2021-04-22 20:53:59','10354FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10416,134561,'A highly contagious infectious disease caused by MORBILLIVIRUS, common among children but also seen in the nonimmune of any age, in which the virus enters the respiratory tract via droplet nuclei and multiplies in the epithelial cells, spreading throughout the reticuloendothelial system. (From Dorland, 27th ed)','en',1,'2007-11-02 20:12:00',1,'2021-04-20 21:49:36','10416FFFFFFFFFFFFFFFFFFFFFFFFF