INSERT INTO `serialized_object` VALUES (1,'Number of Visits','Number of visits in a given date range','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"9667a78e-4881-11e7-a919-92ebcb67fe33\" retired=\"false\">\n  <name>Number of Visits</name>\n  <description>Number of visits in a given date range</description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2022-01-31 19:28:13 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Start date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>endDate</name>\n      <label>End date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>activeVisits</name>\n      <label>Include Active Visits</label>\n      <type>java.lang.Boolean</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"9\">\n    <entry>\n      <string>Visit Count</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" retired=\"false\">\n          <name>Number of Visits</name>\n          <parameters reference=\"4\"/>\n          <sqlQuery>SELECT max(vt.name) as VisitType ,count(v.visit_id) as Count FROM visit v INNER JOIN visit_type vt ON v.visit_type_id=vt.visit_type_id WHERE v.location_id = :location AND v.date_started &gt;= :startDate AND (v.date_stopped &lt;= :endDate OR True = :activeVisits) GROUP BY vt.visit_type_id ;</sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>activeVisits</string>\n            <string>${activeVisits}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2022-02-01 08:28:13',2,NULL,NULL,0,NULL,NULL,NULL,'9667a78e-4881-11e7-a919-92ebcb67fe33'),(2,'Number of Admissions','Number of Admissions for a given location','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"d39509bc-4881-11e7-a919-92ebcb67fe33\" retired=\"false\">\n  <name>Number of Admissions</name>\n  <description>Number of Admissions for a given location</description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2022-01-31 19:28:13 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"6\">\n    <entry>\n      <string>Admission Count</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"7\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"8\" retired=\"false\">\n          <name>Number of Admissions</name>\n          <parameters reference=\"4\"/>\n          <sqlQuery>select count(*) as Count from encounter e where e.encounter_type=(select encounter_type_id from encounter_type where uuid=&apos;e22e39fd-7db2-45e7-80f1-60fa0d5a4378&apos;) and e.location_id=:location and e.voided = false group by e.encounter_type </sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"9\">\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2022-02-01 08:28:13',2,NULL,NULL,0,NULL,NULL,NULL,'d39509bc-4881-11e7-a919-92ebcb67fe33'),(3,'List of Providers','List all providers grouped by active and inactive providers','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"d3950ea8-4881-11e7-a919-92ebcb67fe33\" retired=\"false\">\n  <name>List of Providers</name>\n  <description>List all providers grouped by active and inactive providers</description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2022-01-31 19:28:13 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>retired</name>\n      <label>Retired Users</label>\n      <type>java.lang.Boolean</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"6\">\n    <entry>\n      <string>listOfProviders</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"7\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"8\" retired=\"false\">\n          <name>List of Providers</name>\n          <parameters reference=\"4\"/>\n          <sqlQuery>SELECT pro.uuid AS ProviderUuid, pro.identifier AS Provider, pname.family_name as FamilyName, pname.given_name as GivenName, role.name AS RoleName, pro.date_created AS Created FROM provider pro INNER JOIN providermanagement_provider_role role ON pro.provider_role_id = role.provider_role_id INNER JOIN person_name pname on  pname.person_id = pro.person_id WHERE pro.retired = :retired; </sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"9\">\n          <entry>\n            <string>retired</string>\n            <string>${retired}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2022-02-01 08:28:13',2,NULL,NULL,0,NULL,NULL,NULL,'d3950ea8-4881-11e7-a919-92ebcb67fe33'),(4,'List of Patients for this Provider','List all patients who have worked with the given provider','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"e451ae04-4881-11e7-a919-92ebcb67fe45\" retired=\"false\">\n  <name>List of Patients for this Provider</name>\n  <description>List all patients who have worked with the given provider</description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2022-01-31 19:28:13 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>providerUuid</name>\n      <label>Provider UUID</label>\n      <type>java.lang.String</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"6\">\n    <entry>\n      <string>listOfPatientsForProvider</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"7\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"8\" retired=\"false\">\n          <name>List of Patients for this Provider</name>\n          <parameters reference=\"4\"/>\n          <sqlQuery>select max(per.person_id) as PersonId, max(per.uuid) as PersonUuid, max(patIden.identifier) as OpenMRS_ID, max(pname.given_name) as Given_Name, max(pname.family_name) as Family_Name, max(enc.encounter_datetime) as EncounterDate from encounter enc INNER JOIN patient pat on enc.patient_id = pat.patient_id INNER JOIN person per on enc.patient_id = per.person_id INNER JOIN person_name pname on pname.person_id = pat.patient_id INNER JOIN patient_identifier patIden on patIden.patient_id = pat.patient_id INNER JOIN encounter_provider encProvider on encProvider.encounter_id = enc.encounter_id INNER JOIN provider pro on pro.provider_id = encProvider.provider_id WHERE pro.uuid=:providerUuid group by pat.patient_id limit 0,10; </sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"9\">\n          <entry>\n            <string>providerUuid</string>\n            <string>${providerUuid}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2022-02-01 08:28:13',2,NULL,NULL,0,NULL,NULL,NULL,'e451ae04-4881-11e7-a919-92ebcb67fe45'),(5,'Number of Transfers','Number of Transfers for a given location','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"b39c4c4c-4881-11e7-a919-92ebcb67fe33\" retired=\"false\">\n  <name>Number of Transfers</name>\n  <description>Number of Transfers for a given location</description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2022-01-31 19:28:13 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"6\">\n    <entry>\n      <string>Transfer Count</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"7\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"8\" retired=\"false\">\n          <name>Number of Transfers</name>\n          <parameters reference=\"4\"/>\n          <sqlQuery>select count(*) as Count from encounter e where e.encounter_type=(select